清潔感のあるホワイトベースの磁器に繊細なマリンロゴをデザインしたタンブラー♪<br>
タンブラーとしてはもちろん、歯ブラシスタンドや小物入れなどにもおすすめです。<br>
白い磁器の清潔感がバスルームやパウダールームを凛とした雰囲気に。<br>
<br>
